import styled, { createGlobalStyle, css } from 'styled-components';

export default createGlobalStyle`
  *{
    margin: 0px;
    padding: 0px;
    box-sizing: border-box;
  }
  html, body, div, span, applet, object, iframe,
  h1, h2, h3, h4, h5, h6, p, blockquote, pre,
  a, abbr, acronym, address, big, cite, code,
  del, dfn, em, img, ins, kbd, q, s, samp,
  small, strike, strong, sub, sup, tt, var,
  b, u, i, center,
  dl, dt, dd, ol, ul, li,
  fieldset, form, label, legend,
  table, caption, tbody, tfoot, thead, tr, th, td,
  article, aside, canvas, details, embed,
  figure, figcaption, footer, header, hgroup,
  menu, nav, output, ruby, section, summary,
  time, mark, audio, video {
    margin: 0;
    padding: 0;
    border: 0;
    font-size: 100%;
    font: inherit;
    vertical-align: baseline;
  }
  article, aside, details, figcaption, figure,
  footer, header, hgroup, menu, nav, section {
    display: block;
  }
  input, select, textarea {
    outline: none;
  }
  ol, ul {
    list-style: none;
    padding: 0px;
  }
  a {
    text-decoration: none;
  }
  button {
    outline: none !important;
  }
  blockquote, q {
    quotes: none;
  }
  blockquote:before, blockquote:after,
  q:before, q:after {
    content: '';
    content: none;
  }
  table {
    border-collapse: collapse;
    border-spacing: 0;
  }
  @font-face {
    font-family: 'BrandonGrotesqueRegular';
      src: url('data:application/font-woff2;charset=utf-8;base64,') format('woff2'),
          url('data:application/font-woff;charset=utf-8;base64,') format('woff'),
          url('BrandonGrotesque-Regular.svg#BrandonGrotesque-Regular') format('svg');
      font-weight: normal;
      font-style: normal;
      font-display: swap;
  }
  @font-face {
    font-family: 'BrandonGrotesqueLight';
    src: url('data:application/font-woff2;charset=utf-8;base64,') format('woff2'),
        url('data:application/font-woff;charset=utf-8;base64,') format('woff'),
        url('BrandonGrotesque-Light.svg#BrandonGrotesque-Light') format('svg');
    font-weight: 300;
    font-style: normal;
    font-display: swap;
  }
  @font-face {
    font-family: 'BrandonGrotesqueMedium';
    src: url('data:application/font-woff2;charset=utf-8;base64,') format('woff2'),
        url('data:application/font-woff;charset=utf-8;base64,') format('woff'),
        url('BrandonGrotesque-Medium.svg#BrandonGrotesque-Medium') format('svg');
    font-weight: 500;
    font-style: normal;
    font-display: swap;
  }
  @font-face {
    font-family: 'BrandonGrotesqueBlack';
    src: url('data:application/font-woff2;charset=utf-8;base64,') format('woff2'),
        url('data:application/font-woff;charset=utf-8;base64,') format('woff'),
        url('BrandonGrotesque-Black.svg#BrandonGrotesque-Black') format('svg');
    font-weight: 900;
    font-style: normal;
    font-display: swap;
  }

  body {
    overflow-x: hidden;
    transition: 0.5s;
    font-family: 'BrandonGrotesqueMedium';
    font-size: 18px;
    background: ${props => props.theme.colors.bg};
    input, select, textarea {
      font-family: 'BrandonGrotesqueMedium';
      border-radius: 30px;
      border: none;
      font-size: 16px;
      color: ${props => props.theme.colors.dark};
      padding: 15px;
      transition: 0.5s;
      background: ${props => props.theme.colors.light};
      &::placeholder {
        color: ${props => props.theme.colors.dark};
      }
      &[type='submit'] {
        padding: 0px;
        cursor: pointer;
      }
      &.has-error {
        color: #f00;
        background: #fce8e8;
      }
    }
  }
  #nprogress {
		pointer-events: none;
		.bar {
			position: fixed;
			z-index: 1031;
			top: 0;
			left: 0;
			width: 100%;
			height: 5px;
			background: ${props => props.theme.colors.primary}
		}
	}
  .react-reveal {
		opacity: 0;
  }
  .default-title {
    width: 100%;
    font-family: 'BrandonGrotesqueBlack';
    color: ${props => props.theme.colors.primary};
    font-weight: normal;
    text-transform: uppercase;
    text-align: center;
    font-size: calc(1.875rem + ((1vw - 2.5px) * 2.3952));
    line-height: calc(1.875rem + ((1vw - 2.5px) * 2.3952));
    margin: 0px 0px 100px 0px;
    @media (min-width: 1920px) {
      font-size: 70px;
      line-height: 70px;
    }
    @media (max-width: 992px) {
      margin: 0px 0px 50px 0px;
    }
  }
`;

interface IContainerProps {
  fullContainer?: boolean;
  smallContainer?: boolean;
}

export const AppBox = styled.div`
  width: 100%;
  max-width: 2560px;
  margin: 0px auto;
  overflow: hidden;
`;

export const Container = styled.div<IContainerProps>`
  width: 96%;
  max-width: 1680px;
  margin: 0px auto;
  position: relative;
  ${props =>
    props.fullContainer &&
    css`
      max-width: 1920px;
    `}

  ${props =>
    props.smallContainer &&
    css`
      max-width: 1440px;
    `}
`;

export const SwitchTheme = styled.button`
  position: fixed;
  z-index: 20;
  top: 50%;
  right: -40px;
  transform: translate(0px, -50%);
  padding: 8px;
  transition: 0.5s;
  border: none;
  cursor: pointer;
  text-align: center;
  color: ${props => props.theme.colors.light};
  background: ${props => props.theme.colors.primary};
  &:hover {
    right: 0px;
  }
  &:before {
    content: '';
    position: absolute;
    top: 50%;
    left: -7px;
    transform: translate(0px, -50%);
    display: inline-block;
    vertical-align: middle;
    margin-right: 10px;
    width: 0;
    height: 0;

    border-top: 8px solid transparent;
    border-bottom: 8px solid transparent;
    border-right: 8px solid ${props => props.theme.colors.primary};
  }
`;
